import React, { FC } from "react";

interface IngredientProps {
  quantity: number;
  unit: string;
  description: string;
}

const Ingredient: FC<IngredientProps> = ({ quantity, unit, description }) => (
  <div data-testid="Ingredient">
    {quantity} {unit} {description}
  </div>
);

export default Ingredient;
